import { ProductProps } from "components/Product/types";

import { CardProductImage } from "components/Product/ProductStyled";
import { CardProductBody } from "components/Product/ProductStyled";

const Product = ({ product }: ProductProps): any => {
	return (
		<>
			<a href={`/product/${product.vendorСode}`}>
				<CardProductImage src={product.image} alt={product.name} />
			</a>

			<CardProductBody>
				<a href={`/product/${product.vendorСode}`}>
					<Card.Title as='div'>
						<strong>{product.name}</strong>
					</Card.Title>
				</a>

				{product.vendorСode}
				<div>
					<span>{product.name}</span>
				</div>
				<div>{product.description}</div>
				<div>{product.price}</div>
			</CardProductBody>
		</>
	);
};

export default Product;
